import {Form,Button}from "react-bootstrap"
import { register }  from '../functionAuth/functionAuth'

export default class Owneradd extends Component {
    state = {
    };
    onChangHandler = e => {
      this.setState({
        [e.target.name]: e.target.value
      });
    };
    onSubmitHandelr = e => {
      e.preventDefault();
      newItem(this.state);
      this.props.history.push("/Home");
    };
    onChange = date => this.setState({ date })
    render() {

      return (
        <div class="container">
          <Form onSubmit={this.onSubmitHandelr}>
            <h3 className="ttb">Sign Up</h3>
            <Form.Field className="form-group">
              <label className="tb">First name</label>
              <input
                placeholder="First Name"
                className="form-control"
                name="first_name"
                onChange={this.onChangHandler}
              />
            </Form.Field>
            <Form.Field className="form-group">
              <label className="tb">Last name</label>
              <input
                placeholder="Last Name"
                className="form-control"
                name="last_name"
                onChange={this.onChangHandler}
              />
            </Form.Field>
            <Form.Field className="form-group">
              <label className="tb">Price</label>
              <input
                placeholder="price"
                name="email"
                onChange={this.onChangHandler}
              />
            </Form.Field>
            <Button type="submit" className="btn btn-primary btn-block">
              Submit
            </Button>

          </Form>
        </div>
      );
    }
  }
